var $bm_rt;
var disableBounce, eVar, gVar, nMaxVar;
try {
    disableBounce = effect('Bounce')('Disable Bounce').value;
    eVar = $bm_div(effect('Bounce')('Elasticity').value, 100);
    gVar = $bm_mul(effect('Bounce')('Gravity').value, 100);
    nMaxVar = effect('Bounce')('nMax').value;
    function bounce(e, g, nMax) {
        var n, t, v, vl, vu, tCur, segDur, tNext, nb, delta;
        n = 0;
        if (numKeys > 0) {
            n = nearestKey(time).index;
            if (key(n).time > time)
                n--;
        }
        if (n > 0) {
            t = $bm_sub(time, key(n).time);
            v = $bm_mul($bm_neg(velocityAtTime($bm_sub(key(n).time, 0.001))), e);
            vl = length(v);
            if ($bm_isInstanceOfArray(value)) {
                vu = vl > 0 ? normalize(v) : [
                    0,
                    0,
                    0
                ];
            } else {
                vu = v < 0 ? -1 : 1;
            }
            tCur = 0;
            segDur = $bm_div($bm_mul(2, vl), g);
            tNext = segDur;
            nb = 1;
            while (tNext < t && nb <= nMax) {
                vl *= e;
                segDur *= e;
                tCur = tNext;
                tNext = $bm_sum(tNext, segDur);
                nb++;
            }
            if (nb <= nMax) {
                delta = $bm_sub(t, tCur);
                return $bm_sum(value, $bm_mul($bm_mul(vu, delta), $bm_sub(vl, $bm_div($bm_mul(g, delta), 2))));
            } else {
                return value;
            }
        } else {
            return value;
        }
    }
    ;
    $bm_rt = [
        bounce = bounce(eVar, gVar, nMaxVar),
        value
    ][disableBounce];
} catch (err) {
    $bm_rt = value;
}
;

